                     <div class="t m0 x2 h3 y9 ff2 fs1 fc1 sc0 ls0 ws0">Please note that Copy B and other copies of this form, which appear in black, may be </div>
                     <div class="t m0 x2 h3 ya ff2 fs1 fc1 sc0 ls0 ws0">downloaded and printed and used to satisfy the requirement to provide the information to </div>
                     <div class="t m0 x2 h3 yb ff2 fs1 fc1 sc0 ls0 ws0">the recipient.</div>
                     <div class="t m0 x2 h3 yc ff2 fs1 fc1 sc0 ls0 ws0">If you have 10 or more information returns to file, you may be required to file e-file. Go to </div>
                     <div class="t m0 x2 h3 yd ff2 fs1 fc2 sc0 ls0 ws0">IRS.gov/InfoReturn<span class="fc1"> for e-file options. </span></div>
                     <div class="t m0 x2 h3 ye ff2 fs1 fc1 sc0 ls0 ws0">If you have fewer than 10 information returns to file, we strongly encourage you to e-file. If </div>
                     <div class="t m0 x2 h3 yf ff2 fs1 fc1 sc0 ls0 ws0">you want to file them on paper, you can place an order for the official IRS information </div>
                     <div class="t m0 x2 h3 y10 ff2 fs1 fc1 sc0 ls0 ws0">returns, which include a scannable Copy A for filing with the IRS and all other applicable </div>
                     <div class="t m0 x2 h3 y11 ff2 fs1 fc1 sc0 ls0 ws0">copies of the form, at <span class="fc2">IRS.gov/EmployerForms</span>. Well mail you the forms you request and </div>
                     <div class="t m0 x2 h3 y12 ff2 fs1 fc1 sc0 ls0 ws0">their instructions, as well as any publications you may order. </div>
                     <div class="t m0 x2 h3 y13 ff2 fs1 fc1 sc0 ls0 ws0">See Publications <span class="fc2">1141</span>, <span class="fc2">1167</span>, and <span class="fc2">1179</span> for more information about printing these forms.</div>
