               <div id="pf5" class="pf w0 h0" data-page-no="5">
                  <div class="pc pc5 w0 h0">
                     <img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/>
                     <div class="t m0 x3 h5 y5a ff4 fs2 fc1 sc0 ls0 ws0">Instructions for Recipient</div>
                     <div class="t m0 x3 hc y5b ff4 fs3 fc1 sc0 ls0 ws0">Recipients taxpayer identification number (TIN).<span class="ff3"> For your protection, this </span></div>
                     <div class="t m0 x3 h7 y5c ff3 fs3 fc1 sc0 ls0 ws0">form may show only the last four digits of your social security number (SSN), </div>
                     <div class="t m0 x3 h7 y5d ff3 fs3 fc1 sc0 ls0 ws0">individual taxpayer identification number (ITIN), adoption taxpayer identification </div>
                     <div class="t m0 x3 h7 y5e ff3 fs3 fc1 sc0 ls0 ws0">number (ATIN), or employer identification number (EIN). However, the payer has </div>
                     <div class="t m0 x3 h7 y5f ff3 fs3 fc1 sc0 ls0 ws0">reported your complete TIN to the IRS.</div>
                     <div class="t m0 x3 hc y60 ff4 fs3 fc1 sc0 ls0 ws0">Account number. <span class="ff3">May show an account or other unique number the payer</span> </div>
                     <div class="t m0 x3 h7 y61 ff3 fs3 fc1 sc0 ls0 ws0">assigned to distinguish your account.</div>
                     <div class="t m0 x3 hc y62 ff4 fs3 fc1 sc0 ls0 ws0">Amounts shown may be subject to self-employment (SE) tax. <span class="ff3">Individuals </span></div>
                     <div class="t m0 x3 hc y63 ff3 fs3 fc1 sc0 ls0 ws0">should see the Instructions for Schedule SE (Form 1040).<span class="ff4"> </span>Corporations, </div>
                     <div class="t m0 x3 hc y64 ff3 fs3 fc1 sc0 ls0 ws0">fiduciaries, or partnerships must report the amounts on the<span class="ff4"> </span>appropriate line of </div>
                     <div class="t m0 x3 h7 y65 ff3 fs3 fc1 sc0 ls0 ws0">their tax returns.</div>
                     <div class="t m0 x3 hc y66 ff4 fs3 fc1 sc0 ls0 ws0">Form 1099-MISC incorrect? <span class="ff3">If this form is incorrect or has been issued in</span> <span class="ff3">error, </span></div>
                     <div class="t m0 x3 hc y67 ff3 fs3 fc1 sc0 ls0 ws0">contact the payer. If you cannot get this form corrected, attach an<span class="ff4"> </span>explanation </div>
                     <div class="t m0 x3 h7 y68 ff3 fs3 fc1 sc0 ls0 ws0">to your tax return and report your information correctly.</div>
                     <div class="t m0 x3 hc y69 ff4 fs3 fc1 sc0 ls0 ws0">Box 1. <span class="ff3">Report rents from real estate on Schedule E (Form 1040).</span> <span class="ff3">However, </span></div>
                     <div class="t m0 x3 hc y6a ff3 fs3 fc1 sc0 ls0 ws0">report rents on Schedule C (Form 1040) if you provided significant<span class="ff4"> </span>services to </div>
                     <div class="t m0 x3 hc y6b ff3 fs3 fc1 sc0 ls0 ws0">the tenant, sold real estate as a business, or rented personal<span class="ff4"> </span>property as a </div>
                     <div class="t m0 x3 h7 y6c ff3 fs3 fc1 sc0 ls0 ws0">business. See Pub. 527.</div>
                     <div class="t m0 x3 hc y6d ff4 fs3 fc1 sc0 ls0 ws0">Box 2. <span class="ff3">Report royalties from oil, gas, or mineral properties;</span> <span class="ff3">copyrights; and </span></div>
                     <div class="t m0 x3 hc y6e ff3 fs3 fc1 sc0 ls0 ws0">patents on Schedule E (Form 1040). However, report<span class="ff4"> </span>payments for a working </div>
                     <div class="t m0 x3 hc y6f ff3 fs3 fc1 sc0 ls0 ws0">interest as explained in the Schedule E (Form 1040) instructions. For<span class="ff4"> </span>royalties on </div>
                     <div class="t m0 x3 h7 y70 ff3 fs3 fc1 sc0 ls0 ws0">timber, coal, and iron ore, see Pub. 544.</div>
                     <div class="t m0 x3 hc y71 ff4 fs3 fc1 sc0 ls0 ws0">Box 3. <span class="ff3">Generally, report this amount on the Other income line of Schedule 1 </span></div>
                     <div class="t m0 x3 h7 y72 ff3 fs3 fc1 sc0 ls0 ws0">(Form 1040) and identify the payment. The amount shown may be payments </div>
                     <div class="t m0 x3 hc y73 ff3 fs3 fc1 sc0 ls0 ws0">received as<span class="ff4"> </span>the beneficiary of a deceased employee, prizes, awards, taxable </div>
                     <div class="t m0 x3 hc y74 ff3 fs3 fc1 sc0 ls0 ws0">damages,<span class="ff4"> </span>Indian gaming profits, or other taxable income. See Pub. 525. If it is </div>
                     <div class="t m0 x3 hc y75 ff3 fs3 fc1 sc0 ls0 ws0">trade or<span class="ff4"> </span>business income, report this amount on Schedule C or F (Form 1040).</div>
                     <div class="t m0 x3 hc y76 ff4 fs3 fc1 sc0 ls0 ws0">Box 4. <span class="ff3">Shows backup withholding or withholding on Indian gaming profits.</span> </div>
                     <div class="t m0 x3 h7 y77 ff3 fs3 fc1 sc0 ls0 ws0">Generally, a payer must backup withhold if you did not furnish your TIN. See </div>
                     <div class="t m0 x3 hc y78 ff3 fs3 fc1 sc0 ls0 ws0">Form W-9 and Pub. 505 for more information.<span class="ff4"> </span>Report this amount on your </div>
                     <div class="t m0 x3 h7 y79 ff3 fs3 fc1 sc0 ls0 ws0">income tax return as tax withheld.</div>
                     <div class="t m0 x3 hc y7a ff4 fs3 fc1 sc0 ls0 ws0">Box 5. <span class="ff3">Shows the amount paid to you as a fishing boat crew member by the </span></div>
                     <div class="t m0 x3 h7 y7b ff3 fs3 fc1 sc0 ls0 ws0">operator, who considers you to be self-employed. Self-employed individuals </div>
                     <div class="t m0 x3 h7 y7c ff3 fs3 fc1 sc0 ls0 ws0">must report this amount on Schedule C (Form 1040). See Pub. 334.</div>
                     <div class="t m0 x31 hc y7d ff4 fs3 fc1 sc0 ls0 ws0">Box 6. <span class="ff3">For individuals, report on Schedule C (Form 1040).</span></div>
                     <div class="t m0 x31 hc y7e ff4 fs3 fc1 sc0 ls0 ws0">Box 7. <span class="ff3">If checked, consumer products totaling $5,000 or more were sold to you </span></div>
                     <div class="t m0 x31 h7 y7f ff3 fs3 fc1 sc0 ls0 ws0">for resale, on a buy-sell, a deposit-commission, or other basis. Generally, report </div>
                     <div class="t m0 x31 h7 y80 ff3 fs3 fc1 sc0 ls0 ws0">any income from your sale of these products on Schedule C (Form 1040).</div>
                     <div class="t m0 x31 hc y81 ff4 fs3 fc1 sc0 ls0 ws0">Box 8. <span class="ff3">Shows substitute payments in lieu of dividends or tax-exempt interest</span> </div>
                     <div class="t m0 x31 hc y82 ff3 fs3 fc1 sc0 ls0 ws0">received by your broker on your behalf as a result of a loan of your securities.<span class="ff4"> </span></div>
                     <div class="t m0 x31 h7 y83 ff3 fs3 fc1 sc0 ls0 ws0">Report on the Other income line of Schedule 1 (Form 1040).</div>
                     <div class="t m0 x31 hc y84 ff4 fs3 fc1 sc0 ls0 ws0">Box 9. <span class="ff3">Report this amount on Schedule F (Form 1040).</span></div>
                     <div class="t m0 x31 hc y85 ff4 fs3 fc1 sc0 ls0 ws0">Box 10. <span class="ff3">Shows gross proceeds paid to an attorney in connection with legal </span></div>
                     <div class="t m0 x31 h7 y86 ff3 fs3 fc1 sc0 ls0 ws0">services. Report only the taxable part as income on your return.</div>
                     <div class="t m0 x31 hc y87 ff4 fs3 fc1 sc0 ls0 ws0">Box 11. <span class="ff3">Shows the amount of cash you received for the sale of fish if you are in </span></div>
                     <div class="t m0 x31 h7 y88 ff3 fs3 fc1 sc0 ls0 ws0">the trade or business of catching fish.</div>
                     <div class="t m0 x31 hc y89 ff4 fs3 fc1 sc0 ls0 ws0">Box 12. <span class="ff3">May show current year deferrals as a nonemployee under a </span></div>
                     <div class="t m0 x31 h7 y8a ff3 fs3 fc1 sc0 ls0 ws0">nonqualified deferred compensation (NQDC) plan that is subject to the </div>
                     <div class="t m0 x31 h7 y8b ff3 fs3 fc1 sc0 ls0 ws0">requirements of section 409A plus any earnings on current and prior year </div>
                     <div class="t m0 x31 h7 y8c ff3 fs3 fc1 sc0 ls0 ws0">deferrals. </div>
                     <div class="t m0 x31 hc y8d ff4 fs3 fc1 sc0 ls0 ws0">Box 13. <span class="ff3">If the FATCA filing requirement box is checked, the payer is reporting </span></div>
                     <div class="t m0 x31 h7 y8e ff3 fs3 fc1 sc0 ls0 ws0">on this Form 1099 to satisfy its account reporting requirement under chapter 4 </div>
                     <div class="t m0 x31 h7 y8f ff3 fs3 fc1 sc0 ls0 ws0">of the Internal Revenue Code. You may also have a filing requirement. See the </div>
                     <div class="t m0 x31 h7 y90 ff3 fs3 fc1 sc0 ls0 ws0">Instructions for Form 8938.</div>
                     <div class="t m0 x31 hc y91 ff4 fs3 fc1 sc0 ls0 ws0">Box 14. <span class="ff3">Shows your total compensation of excess golden parachute payments</span> </div>
                     <div class="t m0 x31 hc y92 ff3 fs3 fc1 sc0 ls0 ws0">subject to a 20% excise tax. See your tax return instructions for where to<span class="ff4"> </span>report.</div>
                     <div class="t m0 x31 hc y93 ff4 fs3 fc1 sc0 ls0 ws0">Box 15. <span class="ff3">Shows income as a nonemployee under an NQDC plan that does not </span></div>
                     <div class="t m0 x31 h7 y94 ff3 fs3 fc1 sc0 ls0 ws0">meet the requirements of section 409A. Any amount included in box 12 that is </div>
                     <div class="t m0 x31 h7 y95 ff3 fs3 fc1 sc0 ls0 ws0">currently taxable is also included in this box. Report this amount as income on </div>
                     <div class="t m0 x31 h7 y96 ff3 fs3 fc1 sc0 ls0 ws0">your tax return. This income is also subject to a substantial additional tax to be </div>
                     <div class="t m0 x31 h7 y97 ff3 fs3 fc1 sc0 ls0 ws0">reported on Form 1040, 1040-SR, or 1040-NR. See the instructions for your tax </div>
                     <div class="t m0 x31 h7 y98 ff3 fs3 fc1 sc0 ls0 ws0">return.</div>
                     <div class="t m0 x31 hc y99 ff4 fs3 fc1 sc0 ls0 ws0">Boxes 1618. <span class="ff3">Show state or local income tax withheld from the payments.</span></div>
                     <div class="t m0 x31 hc y9a ff4 fs3 fc1 sc0 ls0 ws0">Future developments. <span class="ff3">For the latest information about developments related to </span></div>
                     <div class="t m0 x31 h7 y9b ff3 fs3 fc1 sc0 ls0 ws0">Form 1099-MISC and its instructions, such as legislation enacted after they </div>
                     <div class="t m0 x31 h7 y9c ff3 fs3 fc1 sc0 ls0 ws0">were published, go to <span class="ff7">www.irs.gov/Form1099MISC.</span></div>
                     <div class="t m0 x31 hc y9d ff4 fs3 fc1 sc0 ls0 ws0">Free File Program. <span class="ff3">Go to <span class="ff7">www.irs.gov/FreeFile </span>to see if you qualify for no-cost </span></div>
                     <div class="t m0 x31 h7 y9e ff3 fs3 fc1 sc0 ls0 ws0">online federal tax preparation, e-filing, and direct deposit or payment options.</div>
                  </div>
